import React, {Component} from 'react';

class About extends Component {

  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="About">
        <h1>About</h1>
        <p>Website made with React.js</p>
      </div>
    );
  }

}

export default About;
